import React from 'react';
import 'tachyons';

const ImageLinkForm = () => {
    return (
        <div>
            <p>Enter an image below. The program will recognise any faces within the image</p>
            <div>
                <input type="text" placeholder="Enter url"></input>
                <button></button>
            </div>
        </div>
        
    )
}

export default ImageLinkForm;
